2019年独自到美国流浪打工，经历独自走在街头每家店问工作，
经历在外被人陷害被炒，运气好的是当天遇到一位好心老板收留，
为了省钱每日天没亮起床做饭上班吃，床太贵为了省钱老板给个充气床，冬天 -0 / -18度为了省钱工作穿4件衣服3条裤子，经常会冷的脚麻，因为鞋子不防风，衣服 被子 不够老板都挺好的给一些家里多的衣服和被子，也因为在那一个小意外弄伤鼻子导致鼻中隔偏曲，在外经常流鼻血，回来后也做了手术

独自在外经历饭菜没得选，好坏都得吃，在外挑食只会饿死自己，
经历别太容易相信他人，别人什么时候把你出卖你都不知道，
对任何人保有一定的保留，在外除了自己没人能救的了你

如果疫情过去，也许还会考虑到海外流浪，想多让自己还有能力走的时候多让自己吃点苦头，经历自己的经历
如果这一辈子让你出去一次到海外打工，你会想到哪里去呢？

人这一辈子，上班为了下班， 
下班为了第二天继续， 日复一日慌慌张张，
 也不过是为了碎银几两，偏偏这碎银几两，能解世间各种慌张

还有四个月就2021年了，八月再见，九月你好
九月不需要任何人善待，只希望努力都有结果
希望九月会遇见更好的自我。

